import * as React from 'react';
import { Image, StyleSheet, Text, View, Button, TextInput, TouchableOpacity } from "react-native";
import logo from 'logo.png'



// check JWT to see if user is logged in, if not send to signup/login


function Dash({ navigation }) {
  return (
    <View
      // eslint-disable-next-line react-native/no-inline-styles
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Text>Tickers</Text>
      <Text>Ticked Off</Text>
      <TextInput placeholder='username' type='text' />
      <TouchableOpacity><Text>Submit</Text></TouchableOpacity>


      <Button
        title='Account'
        onPress={() => navigation.navigate('Account')}
      />
      <Button
        title='Create TimeBomb'
        onPress={() => navigation.navigate('TickerForm')}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent
  }
})

export default Dash;
